import { MuiThemeProvider } from "@material-ui/core";
import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <MuiThemeProvider>
        <>
          <h1>This is the cool home page</h1>
        </>
      </MuiThemeProvider>
    );
  }
}

export default Home;
